import React, { useState } from "react";
import { useAuth } from "../context/AuthContext";
import { companyService } from "../services/api";
import { useNavigate } from "react-router-dom";

const CompanySetup = () => {
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    industry: "",
    size: "",
    vision: "",
    mission: "",
    values: "",
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [apiKey, setApiKey] = useState("");
  const [apiUrl, setApiUrl] = useState("");

  const { user } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");

    try {
      const valuesArray = formData.values
        .split(",")
        .map((v) => v.trim())
        .filter((v) => v);

      const companyData = { ...formData, values: valuesArray };

      const response = await companyService.updateCompany(companyData);
      const company = response.data || response;

      // استخراج الـ apiKey وعرض الـ AI API URL
      if (company.apiKey) {
        setApiKey(company.apiKey);
        const backendUrl =
          import.meta.env.VITE_API_URL || "http://localhost:5000/api/company";
        setApiUrl(`${backendUrl}/use-model`);
      } else {
        setError("لم يتم العثور على API Key للشركة");
      }
    } catch (error) {
      setError(error.response?.data?.error || "حدث خطأ أثناء حفظ الشركة");
    } finally {
      setLoading(false);
    }
  };

  if (apiKey && apiUrl) {
    return (
      <div className="max-w-lg mx-auto mt-10 bg-white p-6 rounded-2xl shadow-md">
        <h2 className="text-xl font-semibold text-center mb-4">
          تم إنشاء الشركة بنجاح
        </h2>
        <p className="text-gray-700 mb-3 text-center">
          يمكنك الآن استخدام واجهة الذكاء الاصطناعي الخاصة بشركتك:
        </p>
        <div className="bg-gray-100 p-3 rounded-lg break-all text-sm mb-4">
          <strong>API URL:</strong>
          <br />
          {apiUrl}
        </div>
        <div className="bg-gray-100 p-3 rounded-lg break-all text-sm mb-4">
          <strong>API Key:</strong>
          <br />
          {apiKey}
        </div>
        <p className="text-gray-600 text-center text-sm">
          استخدم هذا الرابط والـ API Key في أي تطبيق خارجي لربط الذكاء الاصطناعي
          بشركتك.
        </p>
        <div className="text-center mt-6">
          <button
            onClick={() => navigate("/dashboard")}
            className="bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700"
          >
            العودة إلى لوحة التحكم
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-lg mx-auto mt-10 bg-white p-6 rounded-2xl shadow-md">
      <h2 className="text-xl font-semibold text-center mb-4">
        إعداد شركتك الجديدة
      </h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <input
          name="name"
          placeholder="اسم الشركة"
          value={formData.name}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
          required
        />
        <textarea
          name="description"
          placeholder="وصف الشركة"
          value={formData.description}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
          required
        />
        <input
          name="industry"
          placeholder="المجال الصناعي"
          value={formData.industry}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
        />
        <input
          name="size"
          placeholder="حجم الشركة"
          value={formData.size}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
        />
        <textarea
          name="vision"
          placeholder="الرؤية"
          value={formData.vision}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
        />
        <textarea
          name="mission"
          placeholder="الرسالة"
          value={formData.mission}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
        />
        <input
          name="values"
          placeholder="القيم (افصل بينها بفواصل)"
          value={formData.values}
          onChange={handleChange}
          className="w-full p-2 border rounded-md"
        />
        {error && <p className="text-red-600 text-center">{error}</p>}
        <button
          type="submit"
          disabled={loading}
          className="w-full bg-blue-600 text-white py-2 rounded-md hover:bg-blue-700"
        >
          {loading ? "جاري الحفظ..." : "حفظ الشركة"}
        </button>
      </form>
    </div>
  );
};

export default CompanySetup;
